import {
    Form,
    Select,
    InputNumber,
    DatePicker,
    Switch,
    Slider,
    Button,
  } from "antd";
  import Link from "next/link";
  import HeaderCovid from './components/component.headercovid'
  import Snapshot from './components/component.snapshot'
  import {useEffect} from 'react'
  
  const FormItem = Form.Item;
  
  function CovidPage2() {
    useEffect(() => {
      localStorage.removeItem('User')
    }, [])
    return (
      <div style={{ marginTop: 0 }}>
        <FormItem>
          <div className="nu-font-covid">
            <div className="nu-flex-column-fs">
              <div
                style={{
                  flexBasis: "auto",
                }}
              >
                <HeaderCovid />
              </div>
              <div
                style={{
                  display: "flex",
                  flexBasis: "auto",
                  height: "100%",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <Snapshot />
              </div>
              <div
                style={{
                  flexBasis: "auto",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                <h5 style={{color:"#FFFFFF80"}}>
                  Copyright © All rights reserved. 2020 มหาวิทยาลัยนเรศวร Naresuan
                  University
                </h5>
              </div>
            </div>
          </div>
        </FormItem>
      </div>
    );
  }
  
  export default CovidPage2;
